import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

import Home from './components/Home';
import App from '../App';

const Main = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path='/' component={Home}></Route>
        <Route exact path='/App' component={App}></Route>
      </Switch>
    </BrowserRouter>
  );
}

export default Main;
